function getGeoJson() {
  // first parse the string of all the coordinates to an array of arrays
  // loop over all the keys in the geo and parse the string to an array of arrays

  for (const aire of geo['aire_sante'].features)
    for (const key in geo) {
      if (geo[key]) {
        for (const feature of geo[key].features) {
          if (feature.geometry && feature.geometry.coordinates) {
            if (key === 'entity') {
              if (typeof feature.geometry.coordinates === 'string')
                // split by comma and map to number
                feature.geometry.coordinates = feature.geometry.coordinates.split(',').map(i => parseFloat(i))
              if (
                feature.geometry.coordinates[0] === null ||
                feature.geometry.coordinates[1] === null ||
                feature.geometry.coordinates[0] === undefined ||
                feature.geometry.coordinates[1] === undefined ||
                isNaN(feature.geometry.coordinates[0]) ||
                isNaN(feature.geometry.coordinates[1])
              ) {
                feature.geometry.coordinates = [0, 0]
              }
            }
            if (typeof feature.geometry.coordinates === 'string')
              feature.geometry.coordinates = [JSON.parse(feature.geometry.coordinates)]
          }

          // if cordinates are not defined or null pop the feature
          if (feature.geometry && (!feature.geometry.coordinates || feature.geometry.coordinates === null)) {
            feature.geometry.coordinates = []
          }
        }
      }
    }


  return geo
}

export default getGeoJson

